    false,nt"url": null,nt"notes": "This narrative report for Fort Peck NWR
    outlines Refuge accomplishments from January through April of 1946. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    rodents, raptors, and fish- is also covered. The Refuge development and maintenance
    section discusses physical developments and plantings. Resource management is outlined;
    topics include fur harvesting and timber removal. The public relations section of
    the report describes recreational uses, Refuge participation, and fishing. N-R forms
    and an annual summary are attached.",nt"license_title": "License Not Specified",nt"extras":
